import React from 'react';

const PredictedResults = ({ predictedDisease, onReset }) => {
  return (
    <div className="flex flex-col items-center mt-8">
      <div className="bg-gray-200 p-4 rounded-lg shadow-md">
        <h2 className="text-xl font-bold mb-2">Predicted Disease:</h2>
        <p className="text-lg text-blue-700">{predictedDisease}</p>
      </div>
      <button
        onClick={onReset}
        className="mt-4 bg-gray-500 hover:bg-gray-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
      >
        Reset
      </button>
    </div>
  );
};

export default PredictedResults;
